import React from "react";
import '../styles.css';
import ReactList from 'react-list';
// ^This will be used to link to the sign up page

function Examples() {
    const examples = [<h1>"Example Query 1"</h1>,"Example Query 2","Example Query 3","Example Query 4","Example Query 5"]
    function renderItem(index, key) {
        return <div key={key}>{examples[index]}</div>
    }

    return (
        <div className = 'page'>
            <h1>Examples</h1>
                <div className = 'loginblock'>
                    <div style={{overflow: 'auto', maxHeight:300}}>
                        <ReactList
                            itemRenderer={renderItem}
                            length={examples.length}
                            type='uniform'
                        />
                    </div>
                </div>
        </div>
    )
}

export default Examples;
